plot


Investment banker Harold Lee is taken advantage of by coworkers Billy Carver and J.D., who give him extra work so they can enjoy a long weekend. Harold's roommate Kumar Patel interviews for medical school admission; despite being an ideal candidate, he prefers getting stoned and enjoying himself. He attends the interview to please his father and is rejected when he answers his cell phone and talks about getting high with Harold.


